import React from "react";
import ReactDOM from "react-dom";
import Card from "./Card";
import "./index.css";
import data from "./data";
// import App from "./App";
// import { Add, Divide, Mod, Mul, Sub } from "./Clc";

function index(n) {
  return <Card imgsrc={n.imgsrc} title={n.title} sn={n.sn} link={n.link} />;

  console.log(n);
}

index();

ReactDOM.render(
  <>
    <h1 className="d-block text-center fs-1 bg-secondary text-white">
      Web Series
    </h1>
    <div className="container">
      <div className="cards   ">
        {data.map(n)}
      </div>
    </div>
  </>,
  document.getElementById("root")
);
